window.bookSummaryJSON = "<p><b>Jenny is back in America, but this time she is looking to settle down. Or is she?</b></p> <p>Rogue has gone house hunting with a purpose, but what is the house for? Having learned the lesson that you keep your friends close, but your (potential) enemies&nbsp;closer, Jennie has the SIA pulled up close against her chest. Are they truly full of politics and red tape as she suspects?</p> <p>Jennie has to deal with a new paranormal creature, and this one wants to dine on her flesh. There are a lot of the little creatures, but what they lack in size they make up for in quantity. Now, Jennie must figure out how to get the construct they creature to heel. Can she do it?</p>"; 
